import React from 'react';
import './Header.css';
import logo from './logo.png';

const Park = function (props){
  return (
  	<div>
    <div className="nav">
      <img src={logo} className="logo" alt="logo"/>
      <button className="btn"></button>
    </div>
    {this.props.children}
    </div>
  );
}

export default Park;
